//Admin part
app.controller('addConferenceCtrl', function($scope, $location,$rootScope, $http, $state) {


    $scope.params = {};
	$rootScope.conf_image="data:image/png;base64,"

    $scope.add = function(params) {

      var conference_Name = params.conference_Name;
      var conference_Location = params.conference_Location;
      var conference_FromDate = params.conference_FromDate;
      var conference_ToDate = params.conference_ToDate;
      var conference_Description = params.conference_Description;
	  var conference_Speakers=params.conference_Speakers;
	  var conference_Agenda=params.conference_Agenda

      var conferenceDetails = {
        "_id": conference_Name,
        "conference_Name": conference_Name,
        "conference_Location": conference_Location,
        "conference_FromDate": conference_FromDate,
        "conference_ToDate": conference_ToDate,
        "conference_Description": conference_Description,
		"conference_Speakers":conference_Speakers,
		"conference_Agenda":conference_Agenda,
		"image":$rootScope.conf_image


      };
	  $rootScope.NewconferenceDetails = conferenceDetails;

	 //console.log(JSON.stringify(conferenceDetails));
	  $location.path("/menu-content/add_conf_logistics");

    }
  })
